package comp533;

import java.rmi.RemoteException;

import assignments.util.inputParameters.AnAbstractSimulationParametersBean;
import assignments.util.mainArgs.ClientArgsProcessor;
import coupledsims.Simulation;
import coupledsims.Simulation1;
import main.BeauAndersonFinalProject;

import java.beans.PropertyChangeListener;
import stringProcessors.HalloweenCommandProcessor;
import util.interactiveMethodInvocation.IPCMechanism;
import util.interactiveMethodInvocation.SimulationParametersControllerFactory;
import util.misc.ThreadSupport;
import util.trace.Tracer;
import util.trace.factories.FactoryTraceUtility;
import util.trace.misc.ThreadDelayed;
import util.trace.port.PerformanceExperimentEnded;
import util.trace.port.PerformanceExperimentStarted;
import util.trace.port.PortTraceUtility;
import util.trace.port.consensus.ConsensusTraceUtility;
import util.trace.port.nio.NIOTraceUtility;
import util.trace.port.rpc.rmi.RMITraceUtility;

public class Client extends AnAbstractSimulationParametersBean implements ClientInterface {

	ServerInterface server;
	HalloweenCommandProcessor commandP1;
	String name;
	protected int NUM_EXPERIMENT_COMMANDS = 500;
	public static final String EXPERIMENT_COMMAND_1 = "move 1 -1";
	public static final String EXPERIMENT_COMMAND_2 = "undo";
	protected PropertyChangeListener listener;
	protected PropertyChangeListener GIPCListener;
	
	public HalloweenCommandProcessor createSimulation(String aPrefix) {
		return 	BeauAndersonFinalProject.createSimulation(
					aPrefix,
					Simulation1.SIMULATION1_X_OFFSET, 
					Simulation.SIMULATION_Y_OFFSET, 
					Simulation.SIMULATION_WIDTH, 
					Simulation.SIMULATION_HEIGHT, 
					Simulation1.SIMULATION1_X_OFFSET, 
					Simulation.SIMULATION_Y_OFFSET);
	}
	
	public Client(ServerInterface server) {
		this.server = server;
		//add GIPC server?
	}

	@Override
	public void start(String[] args) throws RemoteException {
		// TODO Auto-generated method stub
		init(args);
		SimulationParametersControllerFactory.getSingleton().addSimulationParameterListener(this);
		SimulationParametersControllerFactory.getSingleton().processCommands();
		
	}

	@Override
	public void broadcast(String s) throws RemoteException {
		// TODO Auto-generated method stub
		util.misc.ThreadSupport.sleep(this.getDelay());
		
		util.trace.port.consensus.ProposalLearnedNotificationReceived.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND,-1, s);
		util.trace.port.consensus.ProposedStateSet.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND,-1, s);
		
	}
	
	public void quit() {
		System.exit(0);
	}
	
	
	/**
	 * Just printing some of the  client args needed for the RMI assignment by a client.
	 * In your client, you will need to use the printed client values in calls to
	 * the RMI API. In addition, in the server part, you will need to call
	 * ServerArgsProcessor instead to get the server args.
	 */
	void processArgs(String[] args) {	
		System.out.println("Registry host:" + ClientArgsProcessor.getRegistryHost(args));
		System.out.println("Registry port:" + ClientArgsProcessor.getRegistryPort(args));
		System.out.println("Server host:" + ClientArgsProcessor.getServerHost(args));
		System.out.println("Headless:" + ClientArgsProcessor.getHeadless(args));
		System.out.println("Client name:" + ClientArgsProcessor.getClientName(args));
		name = ClientArgsProcessor.getClientName(args);
		// Make sure you set this property when processing args
		System.setProperty("java.awt.headless", ClientArgsProcessor.getHeadless(args));
		
	}
	
	protected void setTracing() {
		PortTraceUtility.setTracing();
		RMITraceUtility.setTracing();
		NIOTraceUtility.setTracing();
		FactoryTraceUtility.setTracing();		
		ConsensusTraceUtility.setTracing();
		ThreadDelayed.enablePrint();
		trace(true);
	}
	
	
	protected void init (String[] args) {
		setTracing();
		processArgs(args);
		listener = new CouplerListener(ClientArgsProcessor.getClientName(args), server);
		GIPCListener = new GIPCListener(ClientArgsProcessor.getClientName(args), server);
		commandP1 = createSimulation(Simulation1.SIMULATION1_PREFIX);	
		commandP1.addPropertyChangeListener(listener);
		
		//add meta state replica
	}

	@Override	
	public void quit(int aCode) {
		System.exit(aCode);
	}	
	@Override
	public void broadcastMetaState(boolean newValue) {
		setBroadcastMetaState(newValue);
		//super.ipcMechanism(newValue);

		//broadcast to other clients
		
	}
	
	@Override
	public void ipcMechanism(IPCMechanism newValue) {
		super.ipcMechanism(newValue);
		if (isBroadcastMetaState()) {
			try {
				server.broadcastGIPC(name, newValue);
			} catch (RemoteException e) {
				// TODO Auto-generated catch block
				e.printStackTrace();
			}
			//find ipc object to add listener to to broadcast
		}
	}
	
	@Override
	public void simulationCommand(String aCommand) {
		long aDelay = getDelay(); 
		if (aDelay > 0) {
			ThreadSupport.sleep(aDelay);
		}
		commandP1.setInputString(aCommand);
	}
	
	@Override	
	public void trace(boolean newValue) {
		super.trace(newValue);
		Tracer.showInfo(isTrace());
	}
	
	@Override
	public void localProcessingOnly(boolean newValue) {
		super.localProcessingOnly(newValue);
		if (isLocalProcessingOnly()) {
			commandP1.removePropertyChangeListener(listener);
		} else {
			commandP1.addPropertyChangeListener(listener);
		}
	}
	
	@Override
	public void atomicBroadcast(boolean newValue) {
		super.atomicBroadcast(newValue);
		commandP1.setConnectedToSimulation(!isAtomicBroadcast());
	}
	
	@Override
	public void experimentInput() {
		long aStartTime = System.currentTimeMillis();
		PerformanceExperimentStarted.newCase(this, aStartTime, NUM_EXPERIMENT_COMMANDS);
		boolean anOldValue = isTrace();
		this.trace(false);
		for (int i = 0; i < NUM_EXPERIMENT_COMMANDS; i++) {
			commandP1.setInputString(EXPERIMENT_COMMAND_1);
			commandP1.setInputString(EXPERIMENT_COMMAND_2);
		}
		trace(anOldValue);
		long anEndTime = System.currentTimeMillis();
		PerformanceExperimentEnded.newCase(this, aStartTime, anEndTime, anEndTime - aStartTime, NUM_EXPERIMENT_COMMANDS);
		
	}
	
	@Override
	public void delaySends(int aMillisecondDelay) {
		super.delaySends(aMillisecondDelay);
	}

	@Override
	public void broadcastGIPC(IPCMechanism str) throws RemoteException {
		// TODO Auto-generated method stub
		util.misc.ThreadSupport.sleep(this.getDelay());
		
		super.ipcMechanism(str);
		util.trace.port.consensus.ProposalLearnedNotificationReceived.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND,-1, str);
		util.trace.port.consensus.ProposedStateSet.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND,-1, str);
	}	
}

package comp533;

import java.rmi.RemoteException;

import java.util.HashMap;
import java.util.Map;

import assignments.util.inputParameters.AnAbstractSimulationParametersBean;
import util.interactiveMethodInvocation.IPCMechanism;
import util.interactiveMethodInvocation.SimulationParametersControllerFactory;
import util.trace.Tracer;

public class Server extends AnAbstractSimulationParametersBean implements ServerInterface {

	private Map<String, ClientInterface> clientList  = new HashMap<>();
	private Map<String, ClientInterface> clientListGIPC  = new HashMap<>();
	
	@Override
	public void start() throws RemoteException {
		// TODO Auto-generated method stub
		SimulationParametersControllerFactory.getSingleton().addSimulationParameterListener(this);
		SimulationParametersControllerFactory.getSingleton().processCommands();
	}

	@Override
	public void setClients(ClientInterface clientInt, String str) throws RemoteException {
		// TODO Auto-generated method stub
		clientList.put(str, clientInt);

	}
	
	public void setClientsGIPC(ClientInterface clientInt, String str) throws RemoteException {
		// TODO Auto-generated method stub
		clientListGIPC.put(str, clientInt);

	}

	@Override	
	public void trace(boolean newValue) {
		super.trace(newValue);
		Tracer.showInfo(isTrace());
	}
	
	
	@Override
	public void broadcast(String  clientInt, String str) throws RemoteException {
		util.trace.port.consensus.RemoteProposeRequestReceived.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, str);
		if(this.ipcMechanism.equals(IPCMechanism.GIPC)) {
			for (String c : clientListGIPC.keySet()) {
				if (!(c.equals(clientInt))) {
					clientListGIPC.get(c).broadcast(str);
				}
			}
		} else {
		for (String c : clientList.keySet()) {
			if (!(c.equals(clientInt))) {
				clientList.get(c).broadcast(str);
			}
		}
		}
		util.trace.port.consensus.ProposalLearnedNotificationSent.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, str);
		
	}

	@Override
	public void broadcastGIPC(String clientInt, IPCMechanism ipcMechanism) throws RemoteException {
		util.trace.port.consensus.RemoteProposeRequestReceived.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, ipcMechanism);
		this.ipcMechanism = ipcMechanism;
		for (String c : clientList.keySet()) {
			if (!(c.equals(clientInt))) {
				clientList.get(c).broadcastGIPC(ipcMechanism);
			}
		}
		util.trace.port.consensus.ProposalLearnedNotificationSent.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, ipcMechanism);
		
	}
	
	public void quit() {
		System.exit(0);
	}
}

package comp533;

import java.beans.PropertyChangeEvent;
import java.beans.PropertyChangeListener;
import java.rmi.RemoteException;

import util.interactiveMethodInvocation.IPCMechanism;
import util.trace.trickOrTreat.LocalCommandObserved;

public class GIPCListener implements PropertyChangeListener {

	private String name;
	private ServerInterface server;
	
	public GIPCListener(String name, ServerInterface server) {
		this.server = server;
		this.name = name;
	}
	
	public void propertyChange(PropertyChangeEvent evt) {
		//if(!evt.getPropertyName().equals("InputString")) return;
			LocalCommandObserved.newCase(this, (String) evt.getNewValue());
			util.trace.port.consensus.ProposalMade.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, (String) evt.getNewValue());
			try {
				server.broadcastGIPC(name, (IPCMechanism) evt.getNewValue());
				util.trace.port.consensus.RemoteProposeRequestSent.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, (String) evt.getNewValue());

			} catch (RemoteException e) {
				// TODO Auto-generated catch block
				e.printStackTrace();
			}

	}
}

package comp533;

import java.rmi.NotBoundException;
import inputport.rpc.GIPCLocateRegistry;
import inputport.rpc.GIPCRegistry;
import port.ATracingConnectionListener;


import java.rmi.RemoteException;
import java.rmi.registry.LocateRegistry;
import java.rmi.server.UnicastRemoteObject;

import assignments.util.mainArgs.ClientArgsProcessor;
import assignments.util.mainArgs.RegistryArgsProcessor;
import assignments.util.mainArgs.ServerArgsProcessor;
import util.trace.factories.FactoryTraceUtility;
import util.trace.misc.ThreadDelayed;
import util.trace.port.PortTraceUtility;
import util.trace.port.consensus.ConsensusTraceUtility;
import util.trace.port.nio.NIOTraceUtility;
import util.trace.port.rpc.rmi.RMITraceUtility;

import util.annotations.Tags;
import util.tags.DistributedTags;
@Tags({DistributedTags.CLIENT, DistributedTags.RMI, DistributedTags.GIPC})

public class ClientMain {

	protected static GIPCRegistry gipcRegistry;
	
	public static void main(String[] args) {
		startTracing();
		
		java.rmi.registry.Registry registry;
		try {
			int port = ClientArgsProcessor.getRegistryPort(args);
			String host = ClientArgsProcessor.getRegistryHost(args);
			String cliname = ClientArgsProcessor.getClientName(args);
			registry = LocateRegistry.getRegistry(host, port);
			util.trace.port.rpc.rmi.RMIRegistryLocated.newCase(registry, host, port, registry);
			String name = ServerInterface.class.getName();
			ServerInterface server = (ServerInterface) registry.lookup(name);
			util.trace.port.rpc.rmi.RMIObjectLookedUp.newCase(registry, server, name, registry);
			ClientInterface client = new Client(server);
			UnicastRemoteObject.exportObject(client, 0);
			server.setClients(client, cliname);
			//gipc
			gipcRegistry = GIPCLocateRegistry.getRegistry(ClientArgsProcessor.getServerHost(args), ClientArgsProcessor.getGIPCPort(args), cliname);
			if (gipcRegistry == null) {
				System.err.println("Could not connect to server :"
						+ ClientArgsProcessor.getServerHost(args) + ":" + ClientArgsProcessor.getGIPCPort(args));
				System.exit(-1);
			}
			ServerInterface serverGIPC = (ServerInterface) gipcRegistry.lookup(ServerInterface.class, name);
			/*
			 * In GIPC connect listeners can be added for the underlying data channel
			 */
			//ClientInterface clientGIPC = new Client(serverGIPC);
			serverGIPC.setClientsGIPC(client, cliname);
			gipcRegistry.getInputPort().addConnectionListener(
					new ATracingConnectionListener(gipcRegistry.getInputPort()));
			
			//FInish setting clients to gipc server register.
			
			client.start(args);


		} catch (RemoteException | NotBoundException e) {
			// TODO Auto-generated catch block
			e.printStackTrace();
		}
	}
	
	
	
	static void startTracing() {
		PortTraceUtility.setTracing();
		RMITraceUtility.setTracing();
		NIOTraceUtility.setTracing();
		FactoryTraceUtility.setTracing();		
		ConsensusTraceUtility.setTracing();
		ThreadDelayed.enablePrint();
	}
}

