	void broadcastGIPC(String clientInt, IPCMechanism ipcMechanism) throws RemoteException;

}

package comp533;

import java.rmi.RemoteException;

import java.util.HashMap;
import java.util.Map;

import assignments.util.inputParameters.AnAbstractSimulationParametersBean;
import util.interactiveMethodInvocation.IPCMechanism;
import util.interactiveMethodInvocation.SimulationParametersControllerFactory;
import util.trace.Tracer;

public class Server extends AnAbstractSimulationParametersBean implements ServerInterface {

	private Map<String, ClientInterface> clientList  = new HashMap<>();
	private Map<String, GIPCclientInt> clientListGIPC  = new HashMap<>();
	
	@Override
	public void start() throws RemoteException {
		// TODO Auto-generated method stub
		SimulationParametersControllerFactory.getSingleton().addSimulationParameterListener(this);
		SimulationParametersControllerFactory.getSingleton().processCommands();
	}

	@Override
	public void setClients(ClientInterface clientInt, String str) throws RemoteException {
		// TODO Auto-generated method stub
		clientList.put(str, clientInt);

	}
	
	public void setClientsGIPC(GIPCclientInt clientInt, String str) {
		// TODO Auto-generated method stub
		clientListGIPC.put(str, clientInt);

	}

	@Override	
	public void trace(boolean newValue) {
		super.trace(newValue);
		Tracer.showInfo(isTrace());
	}
	
	
	@Override
	public void broadcast(String  clientInt, String str) throws RemoteException {
		util.trace.port.consensus.RemoteProposeRequestReceived.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, str);
		if(this.ipcMechanism.equals(IPCMechanism.GIPC)) {
			for (String c : clientListGIPC.keySet()) {
				if (!(c.equals(clientInt))) {
					clientListGIPC.get(c).broadcast(str);
				}
			}
		} else {
		for (String c : clientList.keySet()) {
			if (!(c.equals(clientInt))) {
				clientList.get(c).broadcast(str);
			}
		}
		}
		util.trace.port.consensus.ProposalLearnedNotificationSent.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, str);
		
	}

	@Override
	public void broadcastGIPC(String clientInt, IPCMechanism ipcMechanism) throws RemoteException {
		util.trace.port.consensus.RemoteProposeRequestReceived.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, ipcMechanism);
		this.ipcMechanism = ipcMechanism;
		for (String c : clientList.keySet()) {
			if (!(c.equals(clientInt))) {
				clientList.get(c).broadcastGIPC(ipcMechanism);
			}
		}
		
		for (String c : clientListGIPC.keySet()) {
			if (!(c.equals(clientInt))) {
				clientListGIPC.get(c).broadcastGIPC(ipcMechanism);
			}
		}
		util.trace.port.consensus.ProposalLearnedNotificationSent.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, ipcMechanism);
		
	}
	
	public void quit() {
		System.exit(0);
	}

	
	public void broadcastMS(String name, boolean newValue) {
		// TODO Auto-generated method stub
		util.trace.port.consensus.RemoteProposeRequestReceived.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, newValue);
		setBroadcastMetaState(newValue);
		for (String c : clientList.keySet()) {
			if (!(c.equals(name))) {
				try {
					clientList.get(c).broadcastMS(newValue);
				} catch (RemoteException e) {
					// TODO Auto-generated catch block
					e.printStackTrace();
				}
			}
		}
		
		for (String c : clientListGIPC.keySet()) {
			if (!(c.equals(name))) {
				clientListGIPC.get(c).broadcastMS(newValue);
			}
		}
		util.trace.port.consensus.ProposalLearnedNotificationSent.newCase(this, util.trace.port.consensus.communication.CommunicationStateNames.COMMAND, -1, newValue);
		
	}

}

